import request from '@/utils/request'

// 获取健康评估详情
export function getHealthAssessment(id) {
  return request({
    url: `/api/health-assessment/${id}`,
    method: 'get'
  })
}

// 创建健康评估
export function createHealthAssessment(data) {
  return request({
    url: '/api/health-assessment',
    method: 'post',
    data
  })
}

// 更新健康评估
export function updateHealthAssessment(id, data) {
  return request({
    url: `/api/health-assessment/${id}`,
    method: 'put',
    data
  })
}

// 获取健康评估列表
export function getHealthAssessmentList(params) {
  return request({
    url: '/api/health-assessment',
    method: 'get',
    params
  })
}
